import React from "react";

import './ContextMenu.scss';

const ContextMenu = () => {
    return (
        <div 
            className="context-menu"
            onContextMenu={(e) => e.preventDefault()}>
            <span>Change Image</span>
            <span>Duplicate</span>
            <span>Delete</span>
        </div>
    );
}

export default ContextMenu;
